import React from 'react';
import { View, Text, Image, TextInput, Button, TouchableOpacity, StyleSheet, } from 'react-native';

const RegisterScreen = ({navigation}) => {
    return (
        <View style={styles.container}>
            <Image source={require("./assets/GMALogo.png")} style={styles.image} />
            <View style={styles.loginbutton}>
                <TouchableOpacity style={styles.TouchableOpacity} onPress={() => navigation.navigate("Login")}>
                    <Text style={styles.login}>Login</Text>
                </TouchableOpacity>
                <TouchableOpacity style={styles.Registerbutton}>
                    <Text style={styles.register}>Register</Text>
                </TouchableOpacity>
                <View style={styles.iconContainer}>
                    <Image style={styles.google} source={require("./assets/Google.png")} />
                    <Image style={styles.facebook} source={require("./assets/logos_facebook.png")} />
                    {/* <Image style={styles.apple} source={require("./assets/apple.png")} /> */}
                </View>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#8BCFFF',
        alignItems: "center",
    },
    image: {
        width: 266,
        height: 266,
    },
    loginbutton: {
        width: 260,
        height: 234,
        backgroundColor: "#FCF8F8",
        marginTop: 20,
        borderRadius: 20,
    },
    TouchableOpacity: {
        width: 224,
        height: 27,
        backgroundColor: "white",
        borderRadius: 10,
        justifyContent: "center",
        alignItems: "center",
        marginLeft: 18,
        marginTop: 62,
    },
    login: {
        color: "#1F3F95",
        fontWeight: "600",
    },
    Registerbutton: {
        width: 224,
        height: 27,
        backgroundColor: "#1F3F95",
        borderRadius: 10,
        justifyContent: "center",
        alignItems: "center",
        marginLeft: 18,
        marginTop: 23,
    },
    register: {
        color: "white",
        fontWeight: "600",
    },
    iconContainer: {
        flexDirection: 'row',
        marginTop: 45,
        alignItems: "center",
        justifyContent: "space-evenly"
    },
});

export default RegisterScreen;
